	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(5).call(this.frame_5).wait(4).call(this.frame_9).wait(2).call(this.frame_11).wait(1).call(this.frame_12).wait(1).call(this.frame_13).wait(3).call(this.frame_16).wait(4).call(this.frame_20).wait(2).call(this.frame_22).wait(4).call(this.frame_26).wait(2));

